import { ArrowOutwardSharp } from "@mui/icons-material";
import { Box, Typography } from "@mui/material";
import React from "react";

function Footer() {
  return (
    <Box
      sx={{
        backgroundImage: "linear-gradient(45deg, #3593B0 0%, #4A9B85 100%)",
        maxWidth: "100%",
        margin: "0 auto",
        padding: 0,
        height: "400px",
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        justifyContent: "center",
        position: "relative",
      }}
    >
      <Typography
        sx={{
          fontFamily: "Manrope, sans-serif !important",
          marginTop:2,
          fontSize: "1.8rem",
          fontWeight: "500",
          color: "white",
          lineHeight: 1.2,
          display: "inline-flex",
          alignItems: "center",
          gap: "8px",
          textAlign: "center",
        }}
      >
        Trending on MMM <ArrowOutwardSharp fontSize="inherit" />
      </Typography>
      <Box
        sx={{
          position: "absolute",
          bottom: "px",
          left: 0,
          width: "100%",
          height: "4px",
          backgroundColor: "white",
          borderRadius: "5px",
        }}
      ></Box>
    </Box>
  );
}

export default Footer;
